import styled from 'styled-components';

const WinnersContainer = styled.div `
    border-color: black;
    max-width: 300px;
    display: flex;
    flex-direction: column;
`;

const Winner = styled.div `
    background-color: grey;
    max-width: 300px;
    display: flex;
    flex-direction: row;
`;

const Name = styled.div `
    width: 100px;
    height: 20px;
`;

const Time = styled.div `
    width: 100px;
    height: 20px;
    position: absolute;
`;

const Date = styled.div `
    width: 100px;
    height: 20px;
    position: absolute;
    right: 0px;
`;

export {Winner, Name, Time, Date}
